  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:24.310228\",\n\t\"name\": \"narrative-report-hutton-lake-national-wildlife-refuge-january-to-april-1963\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Hutton Lake National
  Wildlife Refuge outlines Refuge accomplishments from January through April of 1963.
  The report begins by summarizing the weather conditions, habitat conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
  and raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, collections and receipts, vegetation control,
  prescribed burning, and wildfires. Resource management is outlined; topics include
  grazing and commercial fishing. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, hunting, and violations.
  Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
